import React, { Component } from 'react';
import './Test13.css'

class Test13 extends Component {
    state = {
        data: [
            {no:1,name:'지진희',age:40,addr}
        ]
    }
    
    render() {
        return (
            <div className="Test13">
                
                <thead>
                    <tr>
                        <th>번호</th>
                        <th>이름</th>
                        <th>나이</th>
                        <th>주소</th>
                        <th>참여여부</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>1</td>
                        <td>유재석</td>
                        <td>33</td>
                        <td>서울</td>
                        <td>참여</td>
                    </tr>
                 </tbody>
            </div>
        );
    }
}

export default Test13;
